Ur c'harneg Vektor eo un doare eilpennadur mathematikel aozet er salennoù teknologiezh. Emañ treiñ vektoroù e-bourzh da skouer, a-bouez da arvodoù div, tri pe eil lodenn. An disoc'h a-se vel ur skouer vektor ha diorren dre ur mesk emgefre zo.

Implijout a ra ar Python pakadoù embregerezhioù stummek evit treiñ, renkañ ha gwiriañ vektoroù. Evel-just, ar Python a c'hell sevel implijit vektor evel hec'h embregerezh numpy. Gant numpy, e c'hellit degas ur seurt vektor da 0 pe 1 a-zivout ur lodenn unan pe div e-pad ur c'hod.

Savet e vo ur mab galet da allañ un doare a dremennegezh evit ur vektor 2D.

Ober war-dro numpy am eus skrivet ar c'hod-mañ evit degemer un doare maez evit ar vektor 2D

```python
import numpy as np

def vektor(a, b):
   return np.array([a, b])

def S(vektor1,vektor2):
   return np.add(vektor1,vektor2)

def D(vektor1,vektor2):
    return np.subtract(vektor1,vektor2)

def BA(vektor, alpha):
    return np.multiply(alpha, vektor)

def B(vektor1, vektor2):
    return np.dot(vektor1, vektor2)

def U(vektor):
    return vektor / np.linalg.norm(vektor)
```

Ma vez implijet an holl ag azezañ, e c'hellan daoulemen dre ar c'hod-mañ :

```python
vektor1 = vektor(3,4)
vektor2 = vektor(-1,2)
s = S(vektor1, vektor2)
print("s:", s) #expected output: s: [2 6]

d = D(vektor1, vektor2)
print("d:", d) #expected output: d: [4 2]

ba = BA(vektor1, 3)
print("ba:", ba) #expected output: ba: [ 9 12]

b = B(vektor1, vektor2)
print("b:", b) #expected output: b: 5

u = U(vektor1)
print("u:", u) #expected output: u: [0.6 0.8]
```
****************English Meaning****************
A Vector Space is a mathematical concept taught in technology classrooms. Vector transformations are taught, for example, according to two, three, or more parts. This is illustrated by a vector diagram on a Cartesian plane.

Python's mathematical operations and vector transformations can be accomplished primarily through libraries like numpy. With numpy, a unit vector is created to represent the horizontal and vertical axes of a coordinate plane.

A hardworking student creates a programming methodology for a 2D vector.

This code, written using numpy, creates a template for receiving values for a 2D vector:

```python
import numpy as np

def vector(a, b):
   return np.array([a, b])

def S(vector1,vector2):
   return np.add(vector1,vector2)

def D(vector1,vector2):
    return np.subtract(vector1,vector2)

def BA(vector, alpha):
    return np.multiply(alpha, vector)

def B(vector1,vector2):
    return np.dot(vector1,vector2)

def U(vector):
    return vector / np.linalg.norm(vector)
```

If all values are included, the test results are as follows:

```python
vector1 = vector(3,4)
vector2 = vector(-1,2)
s = S(vector1,vector2)
print("s:", s) #expected output: s: [2 6]

d = D(vector1,vector2)
print("d:", d) #expected output: d: [4 2]

ba = BA(vector1,3)
print("ba:", ba) #expected output: ba: [ 9 12]

b = B(vector1,vector2)
print("b:", b) #expected output: b: 5

u = U(vector1)
print("u:", u) #expected output: u: [0.6 0.8]
```
